import React from 'react';
import { BrowserRouter as Router, Switch, Route, NavLink } from "react-router-dom";
import './style/App.css';
import Welcome from './Welcome';
import LoginBox from './LoginBox';
import URLSettings from './settings'

function App() {


  return (
    <div className="App">
      <Router>
        <Header />
        <Switch>
          <Route exact path={URLSettings.getURL("Home")}> <Welcome /> </Route>
          <Route path={URLSettings.getURL("Login")}> <LoginBox /> </Route>
          <Route path={URLSettings.getURL("Products")}> <Products /> </Route>
          <Route path={URLSettings.getURL("About")}> <About /> </Route>
          <Route path={URLSettings.getURL("NoMatch")}> <NoMatch /> </Route>
        </Switch>
        <Footer />
      </Router>
    </div>
  )
}

const Header = () => {
  return (
    <ul className="header">


      <NavLink activeClassName="active" exact to={URLSettings.getURL("Home")} />
      <NavLink activeClassName="active" exact to={URLSettings.getURL("Login")} />
      <NavLink activeClassName="active" exact to={URLSettings.getURL("Products")} />
      <NavLink activeClassName="active" exact to={URLSettings.getURL("About")} />
      <NavLink activeClassName="active" exact to={URLSettings.getURL("FAQ")} />
    </ul>
  )
}

const Footer = () => {
  return (
    <footer>
      <div className="d-flex justify-content-center align-items-center">
        <span className> © Copyright 2019 - Martin Frederiksen, Andreas Vikke, Emil Svensmark, Asger Sørensen, & William Huusfeldt. </span>
      </div>
    </footer>
  )
}

const Products = () => <div>Products</div>

const About = () => <div>About</div>

const NoMatch = () => <div>No match!</div>

export default App;
